    data: |
      SELECT DISTINCT - COUNT ( * ) AS col2, 3 / - COUNT ( * ) + - COUNT ( * ) FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q10110.out
    data: |
      -9	-9
